pragma solidity ^0.4.24;

import "./AssetTransfer.sol";

contract AssetCore is AssetTransfer  {

    //TODO : supplier sensors check
    //DONE : check value passed
    function transferAsset(address _from,address _to,address _supplier,bytes32 _id,uint _quantity ,uint256 _value) external nullId(_id) ownerOf(_from,_id) checkBalance(_to,_quantity*_value) returns(bool)
    {
        Asset storage asset = assets[_id];
       //lock funds
        //transfer funds

        lockFunds(_from,_value.mul(_quantity));
        lockFunds(_to,_value.mul(_quantity));
        lockFunds(_supplier,_value.mul(_quantity).mul(2));
        updateTransaction(_id,asset,_from,_to,_supplier,asset._value.mul(asset._quantity));
        // TODO update tracking id
        updateAsset(_to,asset._id,asset._value,asset._quantity,asset._trackId);
        addAssetToMap(asset);
        deleteAsset(_from,_id);
        emit LogTransferAssetEvent(_to,_from,_id,asset._name,asset._value,asset._quantity,now);
    }

    function cancelTransaction(address _address,bytes32 _transactionId) external isExisting(_address) {
        Transaction memory transaction = transactions[_transactionId];
        require(transaction._status == Status.PENDING,'You can not cancel your order now');
        updateTransactionInt(_address,_transactionId,Status.CANCELLED);
        updateSensor(_address,transaction._sensorId,Status.AVAILABLE);
        releaseFunds(transaction._from,transaction._amount);
        releaseFunds(transaction._to,transaction._amount);
        releaseFunds(transaction._supplier,transaction._amount*2);//
        emit LogTransactionUpdateEvent (transaction._id , getStringStatusType(transaction._status), now);
    }

    function updateTransactionSensorId(address _supplier,bytes32 _transactionId,bytes32 _sensorId) external isSensorAvailable(_sensorId) isSupplier(_supplier) {
        Transaction memory transaction = transactions[_transactionId];
        updateTransactionInt(_supplier,_transactionId,Status.IN_PROGRESS);
        updateSensor(_supplier,transaction._sensorId,Status.ON_THE_WAY);
        emit LogTransactionUpdateEvent (transaction._id , getStringStatusType(transaction._status), now);
    }

    function updateTransactionPickUp(address _supplier,bytes32 _transactionId,bytes32 _sensorId) external isSensorAvailable(_sensorId) isSupplier(_supplier) {
        Transaction memory transaction = transactions[_transactionId];
        updateSensor(_supplier,transaction._sensorId,Status.PICKED_UP);
        releaseFunds(transaction._from,transaction._amount);
        releaseFunds(transaction._supplier,transaction._amount);
        emit LogTransactionUpdateEvent (transaction._id , getStringStatusType(transaction._status), now);
    }

    function updateTransactionCompleted(address _supplier,bytes32 _transactionId,bytes32 _sensorId) external isSensorAvailable(_sensorId) isSupplier(_supplier) {
        Transaction memory transaction = transactions[_transactionId];
        updateTransactionInt(_supplier,_transactionId,Status.COMPLETED);
        updateSensor(_supplier,transaction._sensorId,Status.DELIVERED);
        releaseFunds(transaction._to,transaction._amount);
        releaseFunds(transaction._supplier,transaction._amount);
        emit LogTransactionUpdateEvent (transaction._id , getStringStatusType(transaction._status), now);
    }

    function getTransactionByAddress(address _address,uint _index) view external  isExisting(_address) returns(
        bytes32,
        string,
        address,
        address,
        address,
        bytes32,
        string,
        uint,
        uint256
    ) {
        checkTransactionIndex(_address,_index);
        bytes32 _id = supplierTransactions[_address][_index]._id;
        return getTransactionById(_id);
    }

    function getTransactionById(bytes32 _transactionId) view public nullId(_transactionId) returns(
        bytes32,
        string,
        address,
        address,
        address,
        bytes32,
        string,
        uint,
        uint256
    ) {
        Transaction memory transaction = transactions[_transactionId];
        string memory _name = assets[transaction._assetId]._name;
        return (
            transaction._id,
            getStringStatusType(transaction._status),
            transaction._from,
            transaction._to,
            transaction._supplier,
            transaction._sensorId,
            _name,
            transaction._amount,
            transaction._updatedAt
        );
    }

    function getTransactionCount(address _address) external view isExisting(_address) returns(uint){
        return supplierTransactions[_address].length;
    }

    function checkTransactionIndex(address _address,uint _index) view internal {
        uint count = supplierTransactions[_address].length;
        require(_index >= 0 && count > _index,'Index not allowed');
    }

}
